DROP TABLE IF EXISTS `users`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `users` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) CHARACTER SET latin1 DEFAULT NULL,
  `birth_date` date DEFAULT NULL,
  `hour_num` int(11) DEFAULT NULL,
  `day_stem_id` int(11) DEFAULT NULL,
  `month_stem_id` int(11) DEFAULT NULL,
  `year_stem_id` int(11) DEFAULT NULL,
  `hour_stem_id` int(11) DEFAULT NULL,
  `day_branch_id` int(11) DEFAULT NULL,
  `month_branch_id` int(11) DEFAULT NULL,
  `year_branch_id` int(11) DEFAULT NULL,
  `hour_branch_id` int(11) DEFAULT NULL,
  `gender` enum('Female','Male','Other') CHARACTER SET latin1 DEFAULT NULL,
  `match_min_age` int(11) DEFAULT '25',
  `match_max_age` int(11) DEFAULT '60',
  `personality_type` enum('Yin','Yang') CHARACTER SET latin1 DEFAULT NULL,
  `phase_id` int(11) DEFAULT NULL,
  `email` varchar(255) CHARACTER SET latin1 NOT NULL,
  `country_code` char(2) CHARACTER SET latin1 DEFAULT NULL,
  `timezone` varchar(50) CHARACTER SET latin1 DEFAULT 'America/New_York',
  `zipcode` varchar(50) CHARACTER SET latin1 DEFAULT NULL,
  `password` varchar(500) CHARACTER SET latin1 DEFAULT NULL,
  `introduction` text CHARACTER SET latin1,
  `distance` int(11) DEFAULT '9999',
  `status` enum('Pending','Active','Inactive','Deleted') DEFAULT 'Active',
  `created_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `deactivated_date` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `deleted_date` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `latitude` float(10,6) DEFAULT '0.000000',
  `longitude` float(10,6) DEFAULT '0.000000',
  `address` varchar(500) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `users_email_uk` (`email`),
  UNIQUE KEY `users_name_uk` (`name`),
  KEY `users_day_stem_id_fk` (`day_stem_id`),
  KEY `users_month_stem_id_fk` (`month_stem_id`),
  KEY `users_year_stem_id_fk` (`year_stem_id`),
  KEY `users_hour_stem_id_fk` (`hour_stem_id`),
  KEY `users_day_branch_id_fk` (`day_branch_id`),
  KEY `users_month_branch_id_fk` (`month_branch_id`),
  KEY `users_year_branch_id_fk` (`year_branch_id`),
  KEY `users_hour_branch_id_fk` (`hour_branch_id`),
  KEY `users_country_code_fk` (`country_code`),
  CONSTRAINT `users_country_code_fk` FOREIGN KEY (`country_code`) REFERENCES `countries` (`country_code`),
  CONSTRAINT `users_day_branch_id_fk` FOREIGN KEY (`day_branch_id`) REFERENCES `branches` (`id`),
  CONSTRAINT `users_day_stem_id_fk` FOREIGN KEY (`day_stem_id`) REFERENCES `stems` (`id`),
  CONSTRAINT `users_hour_branch_id_fk` FOREIGN KEY (`hour_branch_id`) REFERENCES `branches` (`id`),
  CONSTRAINT `users_hour_stem_id_fk` FOREIGN KEY (`hour_stem_id`) REFERENCES `stems` (`id`),
  CONSTRAINT `users_month_branch_id_fk` FOREIGN KEY (`month_branch_id`) REFERENCES `branches` (`id`),
  CONSTRAINT `users_month_stem_id_fk` FOREIGN KEY (`month_stem_id`) REFERENCES `stems` (`id`),
  CONSTRAINT `users_year_branch_id_fk` FOREIGN KEY (`year_branch_id`) REFERENCES `branches` (`id`),
  CONSTRAINT `users_year_stem_id_fk` FOREIGN KEY (`year_stem_id`) REFERENCES `stems` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=81 DEFAULT CHARSET=utf8mb4;
/*!40101 SET character_set_client = @saved_cs_client */;

